import React from "react";

const Voiture = ({ voiture, supprimerVoiture }) => {
  const handleDelete = () => {
    if (window.confirm("Voulez-vous vraiment supprimer cette voiture ?")) {
      supprimerVoiture(voiture.id);
    }
  };

  return (
    <tr>
      <td>{voiture.Marque}</td>
      <td>{voiture.TypeCarburant}</td>
      <td>{voiture.PrixLocation}</td>
      <td>
        <img
          src={voiture.image}
          alt={voiture.Marque}
          style={{ width: "100px" }}
        />
      </td>
      <td>
        <button onClick={handleDelete}>Supprimer</button>
      </td>
    </tr>
  );
};

export default Voiture;
